---
controller_settings:
  - settings:
      REDHAT_USERNAME: "{{ redhat_user }}"
      REDHAT_PASSWORD: "{{ redhat_pass }}"
      INSIGHTS_TRACKING_STATE: "true"
      CUSTOM_LOGO: "data:image/png;base64,"
      CUSTOM_LOGIN_INFO: "Atenção: Você esta logando no Red Hat Ansible Automation Platform. Este sistema é monitorado para garantir a segurança das informações. Todos os acessos e atividades estão sujeitos a registro e análise. O uso não autorizado é proibido e pode resultar em ações legais."
      AUTH_LDAP_SERVER_URI: "ldaps://EQTSPPRACD01.empresa.corp:636"
      AUTH_LDAP_BIND_DN: "CN=sautomator_ans,OU=empresa Energia,OU=Servicos,DC=empresa,DC=corp"
      AUTH_LDAP_BIND_PASSWORD: "{{ ldap_pass }}"
      AUTH_LDAP_START_TLS: "false"
      AUTH_LDAP_REQUIRE_GROUP: "CN=GRP_EQT_AAP,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp"
      AUTH_LDAP_USER_SEARCH:
        - - DC=empresa,DC=corp
          - SCOPE_SUBTREE
          - (sAMAccountName=%(user)s)
        - - OU=empresa Energia,OU=Servicos,DC=empresa,DC=corp
          - SCOPE_SUBTREE
          - (sAMAccountName=%(user)s)
      AUTH_LDAP_USER_ATTR_MAP:
        email: mail
        first_name: givenName
        last_name: sn
      AUTH_LDAP_GROUP_SEARCH:
        - DC=empresa,DC=corp
        - SCOPE_SUBTREE
        - (objectClass=group)
      AUTH_LDAP_GROUP_TYPE: "MemberDNGroupType"
      AUTH_LDAP_GROUP_TYPE_PARAMS:
        member_attr: member
        name_attr: cn
      AUTH_LDAP_USER_FLAGS_BY_GROUP:
        is_superuser:
          - CN=GRP_EQT_AAP_Super,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
        is_system_auditor:
          - CN=GRP_EQT_AAP_Auditor,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
      AUTH_LDAP_ORGANIZATION_MAP:
        eqtl_accenture:
          admins:
            - CN=GRP_EQT_AAP_Super,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
          remove_admins: false
          remove_users: false
          users:
            - CN=GRP_EQT_AAP_ACC,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
        eqtl_default:
          admins:
            - CN=GRP_EQT_AAP_Super,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
          remove_admins: false
          remove_users: false
          users:
            - CN=GRP_EQT_AAP,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
      AUTH_LDAP_TEAM_MAP:
        LDAP Admins:
          organization: eqtl_default
          remove: true
          users: CN=GRP_EQT_AAP_Super,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
        LDAP Auditors:
          organization: eqtl_default
          remove: true
          users: CN=GRP_EQT_AAP_Auditor,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
        LDAP Users:
          organization: eqtl_default
          remove: true
          users: CN=GRP_EQT_AAP,OU=Compartilhamento e Seguranca,OU=Grupos,OU=empresa Energia,DC=empresa,DC=corp
...
